import propTypes from 'prop-types'
import Comp from "./comp"

const Student = (props) => {
  return (
    <div>
        <h1>{props.name}</h1>
        <h1>{props.age}</h1>
        {/* <Comp name = {props.name} />
        <Comp age = {props.age} /> */}
    </div>
  )
}

Student.propTypes = {
    name: propTypes.string,
    age: propTypes.number 
}

Student.defaultProps = {
    name: "Name", 
    age: 0
}

export default Student
